import React from "react";
import Logo from "../img/logo.png";

export default function SignUp() {
  return (
    <div className="signUp">
      <div className="form-container">
        <img src={Logo} alt="InstaLogo" className="signUpLogo" />
      </div>
    </div>
  )
}
